<template>
  <TaskScaffold contenteditable="false" :editor="editor">
    <!-- Render -->
    <template #render>
      <!-- https://www.freeimages.com/de/download/green-frog-1361810 -->
      <div>
        <canvas
          ref="canvas"
          class="ul-public-image-map max-w-full"
          @mousemove="getMousePos($event)"
        >
          <img
            ref="image"
            src="data:image/jpeg;base64,"
            alt="image"
            @load="initCanvas()"
          />
        </canvas>
        Im korrekten, blauen Bereich: {{ hovering }}
      </div>
    </template>

    <!-- Content -->
    <template #content> Content </template>

    <!-- Evaluation -->
    <template #evaluation> Evaluation </template>

    <!-- Options -->
    <template #options> Options </template>
  </TaskScaffold>
</template>

<script lang="ts">
// import {  inject } from "vue";
import { defineComponent, ref } from "vue";

import TaskScaffold from "@/extensions/task/helpers/TaskScaffold.vue";

import { useTask } from "@/extensions/task/helpers";

import type { PropType } from "vue";
import type {
  FHOption,
  FHEvaluation,
  FHOptions,
  FHState,
  FHProps,
  FHEmits,
} from "@/extensions/task/find-hotspots/types";
import type { Editor } from "@tiptap/vue-3";
// import type { InjectedEventBus } from "@/helpers/useEventBus";

export default defineComponent({
  name: "TaskFindHotspots",

  components: {
    TaskScaffold,
  },

  props: {
    id: {
      type: String,
      required: true,
    },
    editor: {
      type: Object as PropType<Editor>,
      required: true,
    },
    options: {
      type: Object as PropType<FHOptions>,
      default() {
        return {};
      },
    },
    content: {
      type: Array as PropType<FHOption[]>,
      default() {
        return [];
      },
    },
    evaluation: {
      type: Object as PropType<FHEvaluation>,
      default() {
        return {};
      },
    },
    state: {
      type: Object as PropType<FHState>,
      default() {
        return {};
      },
    },
  },

  emits: ["update", "submit"],

  setup(props, { emit }) {
    // const { eventBus } = inject("eventBus") as InjectedEventBus;

    const { update } = useTask<FHProps, FHEmits, FHOptions, FHOption[], FHEvaluation, FHState>(
      props,
      emit,
      []
    );

    const canvas = ref();
    const image = ref();
    const hovering = ref(false);

    const initCanvas = () => {
      if (!canvas.value || !image.value) return console.info("No image or canvas found");
      canvas.value.width = image.value.naturalWidth;
      canvas.value.height = image.value.naturalHeight;

      const ctx = canvas.value.getContext("2d");
      const background = new Image();
      background.src = image.value.src;
      ctx.drawImage(background, 0, 0);

      ctx.beginPath();
      ctx.lineWidth = "10";
      ctx.strokeStyle = "blue";
      ctx.rect(750, 50, 150, 80);
      ctx.stroke();
    };

    const getMousePos = (evt: MouseEvent) => {
      const rect = canvas.value.getBoundingClientRect(); // abs. size of element
      const scaleX = canvas.value.width / rect.width; // relationship bitmap vs. element for x
      const scaleY = canvas.value.height / rect.height; // relationship bitmap vs. element for y

      detectHover({
        x: (evt.clientX - rect.left) * scaleX,
        y: (evt.clientY - rect.top) * scaleY,
      });
    };

    const detectHover = (coords: { x: number; y: number }) => {
      hovering.value = coords.x >= 750 && coords.x <= 900 && coords.y >= 50 && coords.y <= 130;
    };

    return {
      update,
      initCanvas,
      canvas,
      image,
      getMousePos,
      hovering,
    };
  },
});
</script>
